# Port setting 
port: 7890 # Port HTTP.
socks-port: 7891  # Port SOCKS5.
redir-port: 7892  # Port REDIR untuk Linux dan macOS.
mixed-port: 7893  # Port Campuran.
mode: rule # Mode, bisa disesuikan berdasarkan kebutuhan ( Default, Direct, Global, Rule ).
log-level: info
# Log level "Info" akan menunjukan informasi ( koneksi, port, Url, error,dll ) ketika clash sedang berjalan.
# OPSI Log lainnya : default, warning, error, debug, silent.
allow-lan: false # NET to LAN.
external-controller: 0.0.0.0:9090
bind-address: "*"
ipv6: false # true - jika ingin mengaktifkannya.
# Ipv6 adalah versi yang lebih baru dibandingkan IPv4 ( IPv6 Punya fitur lebih lengkap dibanding IPv4 ( basically ipv6 is better )). 
# Tapi karena masih banyak website yang menggunakan IPv4 dan belum support IPv6, maka lebih baik didisable/false kan untuk saat ini.
# DNS ini intinya berfungsi untuk mempermudah kalian ketika berselencar di internet.
#========= DNS =====================================================================================================================
dns:
  enable: true # Untuk mengaktifkan DNS, false untuk menonaktifkan.
  ipv6: false #IPv6 untuk DNS.
  enhanced-mode: redir-host
  listen: 0.0.0.0:7894
  fallback-filter:
    geoip: false
    ipcidr:
    - 0.0.0.0/8
    - 10.0.0.0/8
    - 100.64.0.0/10
    - 127.0.0.0/8
    - 169.254.0.0/16
    - 172.16.0.0/12
    - 192.0.0.0/24
    - 192.0.2.0/24
    - 192.88.99.0/24
    - 192.168.0.0/16
    - 198.18.0.0/15
    - 198.51.100.0/24
    - 203.0.113.0/24
    - 224.0.0.0/4
    - 240.0.0.0/4
    - 255.255.255.255/32
  nameserver:
    - https://cloudflare-dns.com/dns-query
    - https://dns.google/dns-query
    - https://1.1.1.1/dns-query
    - tls://8.8.8.8:853
    - tls://dns.rubyfish.cn:853 
    - https://1.1.1.1/dns-query
  fallback:
    - tcp://1.1.1.1
    - tcp://8.8.8.8
    - 1.1.1.1
    - 8.8.8.8
    - 114.114.114.114
    - 119.29.29.29
    - 8.8.4.4
    - 1.0.0.1
#========= TUN. ====================================================================================================================    
tun:
  enable: true
  stack: system 
  macOS-auto-route: true
  macOS-auto-detect-interface: true
  dns-hijack:
    - tcp://8.8.8.8:53
    - tcp://8.8.4.4:53
experimental:
  interface-name: en0
